uint32 ISP_ServiceSetReviewParam(ISP_REVIEW_PARAM_T *param_ptr)
{
	memcpy(&isp_service_ctx.isp_review_param, param_ptr, sizeof(ISP_REVIEW_PARAM_T));
	
	return 0;
}

void ISP_ServiceStartReview(void)
{
	ISP_REVIEW_PARAM_T* param = &(isp_service_ctx.isp_review_param);

	if (prgb565_tmp == NULL)
	{
		prgb565_tmp = malloc(param->input_range.w * param->input_range.h * 2);
	}

	if (param->disp_block_id != ISP_DISPLAY_NONE)
	{
		LCD_EnableBlock(param->disp_lcd_id, param->disp_block_id);
	}

	if (isp_service_ctx.display_user_cb != NULL)
	{
		ISP_FRAME_T isp_frame;

		isp_frame.width = param->disp_range.w;
		isp_frame.height = param->disp_range.h;
		isp_frame.yaddr = isp_service_ctx.prgb565;

		isp_service_ctx.display_user_cb(&isp_frame);
	}
}


void ISP_ServiceStopReview(void)
{
	ISP_REVIEW_PARAM_T* param = &(isp_service_ctx.isp_review_param);
	if (param->disp_block_id != ISP_DISPLAY_NONE)
	{
		LCD_DisableBlock(param->disp_lcd_id, param->disp_block_id);
	}
	if (prgb565_tmp != NULL)
	{
		free(prgb565_tmp);
		prgb565_tmp = NULL;
	}
}

uint32 ISP_ServiceReviewNext(ISP_ADDRESS_T *addr_ptr)
{
	ISP_REVIEW_PARAM_T* param = &(isp_service_ctx.isp_review_param);
	BOOLEAN  is_blk_enable;

	if (param->disp_block_id != ISP_DISPLAY_NONE)
	{
		unsigned char* pbuffer_lcd = LCD_GetBlockBuffer(param->disp_lcd_id, param->disp_block_id);

		get_rgb565_data(addr_ptr->yaddr, addr_ptr->uaddr, addr_ptr->vaddr, param->input_format, param->input_size.w, param->input_size.h, param->input_range.w, param->input_range.h, param->disp_rotation, pbuffer_lcd, param->disp_range.x, param->disp_range.y, param->disp_range.w, param->disp_range.h, prgb565_tmp);
	
    	LCD_InvalidateRect(param->disp_lcd_id, param->disp_range.x, param->disp_range.y, param->disp_range.w, param->disp_range.h);
    
		isp_service_ctx.display_user_cb(0);
	}
	else
	{
		ISP_FRAME_T isp_frame = {0};

		get_rgb565_data(addr_ptr->yaddr, addr_ptr->uaddr, addr_ptr->vaddr, param->input_format, param->input_size.w, param->input_size.h, param->input_range.w, param->input_range.h, param->disp_rotation, isp_service_ctx.prgb565, param->disp_range.x, param->disp_range.y, param->disp_range.w, param->disp_range.h, prgb565_tmp);

		isp_frame.width = param->disp_range.w;
		isp_frame.height = param->disp_range.h;
		isp_frame.yaddr = isp_service_ctx.prgb565;
		isp_service_ctx.display_user_cb(&isp_frame);
	}

    return SCI_SUCCESS;
}

static void IspTimerCallback()
{
	if (isp_service_ctx.isp_flag == 0)
	{
        BLOCKCFG_T  blk_cfg = {0};
        BOOLEAN     is_blk_enable = FALSE;

		ISP_FRAME_T* p_encode_isp_frame = &(isp_service_ctx.encode_isp_frame);
		ISP_FRAME_T* p_dsiplay_isp_frame = &(isp_service_ctx.display_isp_frame);
		unsigned char* pyuv = camera_yuv420_data[isp_service_ctx.count % 10];

        LCD_GetConfigBlock(isp_service_ctx.isp_mpeg_param.disp_lcd_id, isp_service_ctx.isp_mpeg_param.disp_block_id, &blk_cfg);

        if(blk_cfg.resolution == 0) /* RGB888 */
        {
            if(g_is_camera_used)
            {
                simulator_rgb888_data(isp_service_ctx.prgb565, isp_service_ctx.isp_mpeg_param.disp_range.w, isp_service_ctx.isp_mpeg_param.disp_range.h);
            }
            else
            {
                generate_rgb888_data(isp_service_ctx.prgb565, isp_service_ctx.isp_mpeg_param.disp_range.w, isp_service_ctx.isp_mpeg_param.disp_range.h, camera_rgb565_data[isp_service_ctx.count%10]);
            }
        }
        else if(blk_cfg.resolution == 2) /* RGB565 */
        {
            if(g_is_camera_used)
            {
                simulator_rgb565_data(isp_service_ctx.prgb565, isp_service_ctx.isp_mpeg_param.disp_range.w, isp_service_ctx.isp_mpeg_param.disp_range.h);
            }
            else
            {
    	        generate_rgb565_data(isp_service_ctx.prgb565, isp_service_ctx.isp_mpeg_param.disp_range.x, isp_service_ctx.isp_mpeg_param.disp_range.y, isp_service_ctx.isp_mpeg_param.disp_range.w, isp_service_ctx.isp_mpeg_param.disp_range.h, isp_service_ctx.isp_mpeg_param.disp_rotation, camera_rgb565_data[isp_service_ctx.count%10]);
            }
    	}    
    	LCD_SetBlockBuffer(isp_service_ctx.isp_mpeg_param.disp_lcd_id, isp_service_ctx.isp_mpeg_param.disp_block_id, isp_service_ctx.prgb565);

        /* check if block0 is enabled or not, if disabled, enable it first */
    	is_blk_enable = LCD_GetBlockIsEnable(isp_service_ctx.isp_mpeg_param.disp_lcd_id, isp_service_ctx.isp_mpeg_param.disp_block_id);
    	if(!is_blk_enable)
    	{
    	    LCD_EnableBlock(isp_service_ctx.isp_mpeg_param.disp_lcd_id, isp_service_ctx.isp_mpeg_param.disp_block_id);
    	}
		LCD_InvalidateRect(isp_service_ctx.isp_mpeg_param.disp_lcd_id, isp_service_ctx.isp_mpeg_param.disp_range.x, isp_service_ctx.isp_mpeg_param.disp_range.y, isp_service_ctx.isp_mpeg_param.disp_range.w, isp_service_ctx.isp_mpeg_param.disp_range.h);
        /* restore the previous enable status */
    	if(!is_blk_enable)
    	{
    	    LCD_DisableBlock(isp_service_ctx.isp_mpeg_param.disp_lcd_id, isp_service_ctx.isp_mpeg_param.disp_block_id);
    	}
        
		isp_service_ctx.isp_flag = 1;
		if (isp_service_ctx.isp_mpeg_param.data_format == ISP_IMAGE_FORMAT_YUV422)
		{
		    if(g_is_camera_used)
            {
                simulator_yuv422_data(isp_service_ctx.encode_py, isp_service_ctx.encode_puv, isp_service_ctx.isp_mpeg_param.encode_size.w, isp_service_ctx.isp_mpeg_param.encode_size.h);
            }
            else
            {
			    generate_yuv422_data(isp_service_ctx.encode_py, isp_service_ctx.encode_puv, isp_service_ctx.isp_mpeg_param.encode_size.w, isp_service_ctx.isp_mpeg_param.encode_size.h, pyuv, pyuv+64*64, pyuv+64*64*5/4);
            }
		}
		else if (isp_service_ctx.isp_mpeg_param.data_format == ISP_IMAGE_FORMAT_YUV420)
		{
		    if(g_is_camera_used)
            {
                simulator_yuv420_data(isp_service_ctx.encode_py, isp_service_ctx.encode_puv, isp_service_ctx.isp_mpeg_param.encode_size.w, isp_service_ctx.isp_mpeg_param.encode_size.h);
            }
            else
            {
			    generate_yuv420_data(isp_service_ctx.encode_py, isp_service_ctx.encode_puv, isp_service_ctx.isp_mpeg_param.encode_size.w, isp_service_ctx.isp_mpeg_param.encode_size.h, pyuv, pyuv+64*64, pyuv+64*64*5/4);
            }
		}
		p_encode_isp_frame->yaddr = isp_service_ctx.encode_py;
		p_encode_isp_frame->uaddr = isp_service_ctx.encode_puv;
		p_encode_isp_frame->vaddr = 0;
		p_encode_isp_frame->width = isp_service_ctx.isp_mpeg_param.encode_size.w;
		p_encode_isp_frame->height = isp_service_ctx.isp_mpeg_param.encode_size.h;
		isp_service_ctx.encode_user_cb(p_encode_isp_frame);

        if(g_is_camera_used)
        {
            simulator_yuv422_data(isp_service_ctx.display_py, isp_service_ctx.display_puv, isp_service_ctx.isp_mpeg_param.encode_size.w, isp_service_ctx.isp_mpeg_param.encode_size.h);
        }
        else
        {
            generate_yuv422_data(isp_service_ctx.display_py, isp_service_ctx.display_puv, isp_service_ctx.isp_mpeg_param.disp_range.w, isp_service_ctx.isp_mpeg_param.disp_range.h, pyuv, pyuv+64*64, pyuv+64*64*5/4);
		}
		p_dsiplay_isp_frame->yaddr = isp_service_ctx.display_py;
		p_dsiplay_isp_frame->uaddr = isp_service_ctx.display_puv;
		p_dsiplay_isp_frame->vaddr = 0;
		p_dsiplay_isp_frame->width = isp_service_ctx.isp_mpeg_param.disp_range.w;
		p_dsiplay_isp_frame->height = isp_service_ctx.isp_mpeg_param.disp_range.h;
		isp_service_ctx.display_user_cb(p_dsiplay_isp_frame);
	}
	
	isp_service_ctx.count ++;	
}

